import React from 'react';
import ReactDOM from 'react-dom';

const Header = (props) => (
    <>
    <h1>{props.course}</h1>
    </>
)

const Content = (props) => (
    <>
    <p> {props.description} {props.value}</p>
    </>
)

const Total = (props) => (
    <>
    <p> Number of exercises = {props.values.reduce((a,b) => a + b, 0)}</p>
    </>
)

const App = () => {
    const course = "Half Stack app development"
    const part1 = { name: 'Fundamentals of React', exercises:10}
    const part2 = { name: "Using props to pass data", exercises: 7}
    const part3 = { name: "State of component", exercises: 14}
    return (
        <div>
            <Header course={course}/>
            <Content description={part1.name} value={part1.exercises}/>
            <Content description={part2.name} value={part2.exercises}/>
            <Content description={part3.name} value={part3.exercises}/>
            <Total  values={[part1.exercises, part2.exercises, part3.exercises]}/>
        </div>
    )
}

ReactDOM.render(<App />, document.getElementById('root'));
